import React from 'react';
import TextField from '@material-ui/core/TextField';


export default class Models extends React.Component {
    constructor(props){ 
        super(props) 
        this.state = {
        name : '',
        type : '',
        price: '',
        rating : '',
        years : '',
        available : false,
     }
    }
    handleChange(e){
      e.preventDefault();
      this.setState({
        [e.target.name]: e.target.value
      })
    }

     handleOpen = () => {
      setOpen(true);
    };

     handleClose = () => {
      setOpen(false);
    };

    render() {
        const { name, type, price, rating, years, available } = this.state
        return (
        <div>
          <p>Click to get the full Modal experience!</p>
          <button type="button" onClick={handleOpen}>
            Open Modal
          </button>
          <Modal
            aria-labelledby="simple-modal-title"
            aria-describedby="simple-modal-description"
            open={open}
            onClose={handleClose}
            >
            <div style={modalStyle} className={classes.paper}>
              <form noValidate autoComplete="off">
              <TextField
                id="standard-name"
                label="Model"
                value={name}
                onChange={this.handleChange}
                margin="normal"
              />
              <TextField
                id="standard-name"
                label="type"
                value={type}
                onChange={this.handleChange}
                margin="normal"
              />
              <TextField
              id="standard-number"
              label="Price"
              value={price}
              onChange={this.handleChange}
              type="number"
              InputLabelProps={{
              shrink: true,
              }}
              margin="normal"
              />
              <TextField
              id="standard-number"
              label="Rating"
              value={rating}
              onChange={this.handleChange}
              type="number"
              InputLabelProps={{
              shrink: true,
              }}
              margin="normal"
              />
              <TextField
              id="standard-number"
              label="Years"
              value={years}
              onChange={this.handleChange}
              type="number"
              InputLabelProps={{
              shrink: true,
              }}
              margin="normal"
              />
              </form>
              <SimpleModal />
            </div>
          </Modal>
        </div>

          );
        }        
    }
